import React, { useState } from "react";

function Child(props) {
  return (
    <div>
      <div>
        <button
          onClick={() => {
            props.setName("박할아");
          }}
        ></button>
      </div>
      <div>{props.grandName}</div>
    </div>
  );
}
function Mother(props) {
  return <Child grandName={props.grandName} setName={props.setName} />;
}
function Grand() {
  const [name, setName] = useState("김할아");
  return <Mother grandName={name} setName={setName} />;
}
function App() {
  return <Grand />;
}
export default App;

